import React from "react";

const Booklist = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        paddingRight: "10%",
        paddingLeft: "10%"
      }}
    >
      <p>Title</p>
      <p>Author</p>
      <p>ISBN</p>
      <input type="checkbox"></input>
    </div>
  );
};

export default Booklist;
